import { Routes, Route } from "react-router-dom";
import Header from "./components/Header";
import Footer from "./components/Footer";
import Home from "./pages/Home";
import BlockPage from "./pages/BlockPage";
import TxPage from "./pages/TxPage";
import AddressPage from "./pages/AddressPage";
import Tokens from './pages/Tokens';  // <-- correct path and default export needed
import ValidatorPage from './pages/ValidatorPage';
import Blockchain from './pages/Blockchain';



export default function App() {
  return (
    <div className="flex flex-col min-h-screen bg-[#F5F5F5] text-[#36454F]">
      <Header />

      <main className="flex-grow container mx-auto px-4 py-6">
        <Routes>

          <Route path="/" element={<Home />} />

          <Route path="/tx" element={<TxPage />} />
          <Route path="/address" element={<AddressPage />} />
          <Route path="/tokens" element={<Tokens />} />  {/* ‚Üê new route */}
          <Route path="/validators" element={<ValidatorPage />} />
          <Route path="/blockchain" element={<Blockchain />} />
        </Routes>
      </main>

      <Footer />
    </div>
  );
}
